function Footer({ name, footerLinks }) {
  const year = new Date().getFullYear();
  return (
    <footer>
      <p aria-hidden="true">
        <svg width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.25" strokeLinecap="round" strokeLinejoin="round">
          <path d="M5 18c0-2 1-4 3-5 1 0 2 0 3 1 1 1 2 2 2 4 0 1-1 2-2 2-1 0-2 0-3-1-1-1-2-2-2-4z" />
          <path d="M12 7c1-1 2-1 3 0 1 1 1 2 0 3-1 1-2 1-3 0-1-1-1-2 0-3z" />
          <path d="M16 9c2-1 4 0 5 2 0 1 0 2-1 3-1 1-2 1-3 0" />
          <path d="M7 15l-2 2M15 11l2 2" strokeWidth="1" />
        </svg>
      </p>
      <p>Happy to chat, reach out!</p>
      <ul>
        {footerLinks.map((link, i) => (
          <li key={i}>
            <a href={link.url} target="_blank" rel="noopener noreferrer">{link.label}</a>
          </li>
        ))}
      </ul>
      <p style={{ marginTop: '40px', fontSize: '0.7em', opacity: 0.8 }}>
        &copy; {year} <span className="name">{name}</span>
      </p>
      <p style={{ fontSize: '0.6em', opacity: 0.6 }}>
        Inspired by Sharon Zheng
      </p>
    </footer>
  );
}

export default Footer;
